import classes from "./../../css/Dialogs.module.css";
import Contacts from "./Contacts";
import Messages from "./Messages";



const Dialogs = (props) => {
	return (
			<div className={classes.dialogBox}>
			<ContactsContainer store={props.store} contactsData={props.usersDialogs.contactArr} />
			<MessagesContainer store={props.store} messagesData={props.usersDialogs.messageArr} dispatch={props.dispatch} />
			</div>
	);
}

export default Dialogs;
